import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../static/css/HomeContent.css';
import Facebook from './Facebook';


class HomeContent extends React.Component {
  render() {
    return (
      <div>
          <Facebook />
          <Container fluid = {true} style = {{backgroundColor: "#292b2c"}}>
              <Row>
                  <Col className = "home-content-col">
                  </Col>
              </Row>
              <Row style = {{height: "600px"}}>
                  <Col style = {{color: "white", display: "flex", justifyContent: "center"}}>
                    <h2>Manage Daily</h2>
                    <p>Keep Track of Daily Tasks</p>
                  </Col>
                  <Col style = {{color: "white", display: "flex", justifyContent: "center", textAlign: "center"}}>
                    <h2>Flexible Editing</h2>
                    Modify Tasks Based on Personal Needs
                  </Col>
                  <Col style = {{color: "white", display: "flex", justifyContent: "center", textAlign: "center"}}>
                    <h2>User-Friendly</h2>
                    Simple Interface With Beautiful Design
                  </Col>
              </Row>
          </Container>
          <Container fluid = {true}>
              <Row>
                  <Col className = "home-content-col">
                  </Col>
              </Row>
          </Container>
      </div>
);}}

export default HomeContent;
